import React from "react";
class Nav extends React.Component {
  toggleTheme(theme) {
    this.props.setTheme(theme === "light" ? "dark" : "light");
  }
  reverseString(s) {
    let temp = [];
    for (let i = s.length - 1; i >= 0; i--) {
      temp.push(s[i]);
      console.log(temp);
    }
    console.log(temp);
    return temp;
  }
  componentDidMount() {
    this.reverseString(["h", "e", "l", "l", "o"]);
  }
  render() {
    return (
      <div className="navbar">
        <div
          className="nav-link"
          onClick={() => {
            this.props.poMansRouting("home");
          }}
        >
          BananaPhone
        </div>
        <div
          className="nav-link"
          onClick={() => {
            this.props.poMansRouting("dataViz");
          }}
        >
          DataViz
        </div>
        <div
          className="nav-link"
          onClick={() => {
            this.props.poMansRouting("portfolio");
          }}
        >
          Portfolio
        </div>
        <button
          className="sunlight-nighttime ml-auto"
          onClick={() => this.toggleTheme(this.props.myTheme)}
        >
          <div className="sun"></div> <div className="night"></div>
          Theme
        </button>
      </div>
    );
  }
}

export default Nav;
